import { useState, useEffect } from "react"
import axios from "axios";
import Add_Form from ",./add_form_"
       

const View_Data = ()=> {
    const [data,setData] = useState([])
    function getData(){
        axios.get('https://687632cc814c0dfa653b18fc.mockapi.io/user').then((res)=>{
            console.log(res.data);
            setData(res.data)
        })
    }
    useEffect(()=>{
        getData()
    },[])
    return (
    <>
    <Add_Form />
    <div className="view_component">
         <h1>view form</h1>

    <table>
        <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Email</th> 
            <th>Phone</th>
            <th>Delete</th>
            <th>Update</th>
        </tr>{
            data.map((item)=>(

                <tr>
                    <td>{item.id}</td>
                    <td>{item.name}</td>
                    <td>{item.email}</td>
                    <td>{item.phone}</td>
                    <td><button>Delete</button></td>
                     <td><button>Update</button></td>
                    </tr>
            )

            )
        }


    </table>


    </div>
    <h1>view form</h1>

    <table>
        <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Email</th> 
            <th>Phone</th>
            <th>Delete</th>
            <th>Update</th>
        </tr>{
            data.map((item)=>(

                <tr>
                    <td>{item.id}</td>
                    <td>{item.name}</td>
                    <td>{item.email}</td>
                    <td>{item.phone}</td>
                    <td><button>Delete</button></td>
                     <td><button>Update</button></td>
                    </tr>
            )

            )
        }


    </table>


  
    
    </>
    );
} 
export default View_Data;
